import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const FooterContainer = styled.div`
  background: #334155;
  color: white;
  padding: 40px;
  text-align: center;
`;

const Authors = styled.div`
  font-size: 1rem;
  margin-bottom: 15px;
  font-weight: 600;
  color: #e2e8f0;
`;

const Institution = styled.div`
  font-size: 0.9rem;
  opacity: 0.9;
  margin-bottom: 20px;
  line-height: 1.5;
  color: #cbd5e1;
`;

const Citation = styled.div`
  font-size: 0.85rem;
  font-style: italic;
  opacity: 0.8;
  color: #94a3b8;
  padding-top: 15px;
  border-top: 1px solid #475569;
`;

const Footer = () => {
  return (
    <FooterContainer>
      <motion.div
        initial={{ opacity: 0, y: 30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.2 }}
      >
        <Authors>Mandar Bodas, PhD • Qian Luo, MPH • Anushree Vichare, PhD</Authors>
        <Institution>
          Fitzhugh Mullan Institute for Health Workforce Equity<br/>
          Milken Institute of Public Health, George Washington University
        </Institution>
        <Citation>
          International Journal of Environmental Research and Public Health, 2025, 22(9), 1339
        </Citation>
      </motion.div>
    </FooterContainer>
  );
};

export default Footer;
